import styled from "styled-components";

export const StyledLoginButton = styled.button`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  padding: 10px 28px;
  gap: 10px;
  width: 99px;
  height: 40px;
  background: var(--rose-500);
  color: var(--white);
  border-radius: 8px;
  border: none;
  cursor: pointer;
`;
